      <div className="contact-info">
        <Grid className="contact-grid">
          <Cell col={6}>
            <h2>Aspiration</h2>

            <p style={{ width: "75%", margin: "auto", paddingTop: "1em" }}>

            </p>
          </Cell>
          <Cell col={6}>
            <h2>Skills</h2>
            <hr />


          </Cell>
          <Cell col={6}>
            <h2>Skills</h2>
            <hr />


          </Cell>
        </Grid>
      </div>
    );
  }
}

export default About;
